rulesList.cssText:
@media only screen and (min-width: 640px) and (max-width: 1024px) {
  .trustarc-agree-btn, .trustarc-declineall-btn, .trustarc-manage-btn { width: 114px; }
  .trustarc-banner-header { color: rgb(255, 255, 255); font-size: 14px; }
}

@media only screen and (min-width: 1px) and (max-width: 768px) {
  .trustarc-banner-logo { height: 64px; width: 64px; }
  .trustarc-manage-btn, .trustarc-agree-btn, .trustarc-declineall-btn { font-size: 12px; }
  .trustarc-client-logo { padding: 16px 10px; }
}

@media only screen and (min-width: 1px) and (max-width: 640px) {
  .trustarc-banner-container { -webkit-box-orient: vertical; -webkit-box-direction: normal; flex-direction: column; display: flex; }
  .trustarc-banner-header { padding-top: 0px !important; }
  .trustarc-banner-content { flex-wrap: wrap; }
  .trustarc-banner-details { padding: 5px; max-width: 512px; display: flex; -webkit-box-orient: horizontal; -webkit-box-direction: normal; flex-direction: row; }
  .trustarc-consent-buttons { max-width: 100%; padding: 8px 10px; text-align: center; min-height: 38px; display: flex; -webkit-box-orient: horizontal; -webkit-box-direction: reverse; flex-direction: row-reverse; margin: 0px 5px; }
  .trustarc-manage-btn, .trustarc-agree-btn, .trustarc-declineall-btn { font-size: 12px; margin: 5px; width: 100%; }
  .banner-details-container { display: flex; -webkit-box-orient: horizontal; -webkit-box-direction: normal; flex-direction: row; width: auto; }
  .description-group { display: flex; -webkit-box-orient: vertical; -webkit-box-direction: normal; flex-direction: column; }
  .trustarc-banner-body { padding-top: 0px; }
  .trustarc-banner-header { color: rgb(255, 255, 255); padding-top: 16px; padding-bottom: 8px; font-size: 14px; }
}

@media only screen and (min-width: 1px) and (max-width: 425px) {
  .trustarc-consent-buttons { max-width: 100%; padding: 8px 10px; text-align: center; min-height: 38px; display: flex; margin: 0px 5px; }
  .banner-details-container { margin: 10px 10px 0px; }
}

@media only screen and (min-width: 1px) and (max-width: 320px) {
  .trustarc-consent-buttons { max-width: 100%; padding: 8px 10px; text-align: center; min-height: 38px; flex-wrap: wrap; display: flex; margin: 0px 5px; }
  .trustarc-manage-btn, .trustarc-agree-btn, .trustarc-declineall-btn { -webkit-box-flex: 1; flex: 1 0 40%; }
}
